    "2016-03-21T20:03:29.284082",nt"name": "fish-health-data-snake-river-sockeye-salmon-captive-propagation",nt"isopen":
    false,nt"url": null,nt"notes": "In the early 1990s, Redfish Lake sockeye
    salmon from the Sawtooth Basin in Idaho were on the brink of extinction, and they
    were listed as endangered under the US Endangered Species Act in 1991. To prevent
    extinction, a gene rescue captive broodstock program was established for the stock
    that consisted of taking most of the remaining gene pool into captive culture at
    specialized conservation hatcheries at the Manchester Research Station and the Idaho
    Department of Fish and Game Eagle Hatchery. nnEfforts through the decade of the
    1990s consisted of developing techniques for successful culture of sockeye salmon
    to adulthood, establishing rearing and spawning protocols to ensure preservation
    of stock diversity, and habitat enhancement at the rearing lakes. In the early 2000s,
    the program began to include a demographic focus to boost the population through
    rearing and release of enough juveniles to produce some adult returns. For the last
    few years, NWFSC eyed egg production has resulted in over 150,000 smolts being released
    into the Stanley basin annually for recovery, with plans to increase NWFSC eyed
    egg production to support release of half a million smolts in the Stanley Basin
    by 2017.  In 2011, and for the fourth year in a row, record numbers of sockeye adults
    have returned to their native home in Idaho.nnAll fresh mortalities larger than
    100 mm are sent to Fish Health for pathology.  Autopsy data is maintained on their
    database.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
